import React from 'react'

const Map = () => {
    const fruits =["Apple", "Orange","Banana"];
  return (
    <>
    <h2>Fruits name</h2>
    <ul>
        {fruits.map(
            (fruit,index) =>(
                <li key={index}>{fruit}</li>
            )
        )}
    </ul>
    </>
  )
}

export default Map
